import React, { Component } from "react";
import { StyleSheet, View, TouchableOpacity, Text } from "react-native";
import FieldInputWithLabel from "./FieldInputWithLabel";
import GooglePlacesAutocomplete from "react-google-places-autocomplete";
const GOOGLE_API_KEY = "AIzaSyDjx4LBIEDNRYKEt-0_TJ6jUcst4a2YON4";

function DeliveryDetails({
  storeDetails,
  setorderDetails,
  orderDetails,
  setpage,
}) {
  return (
    <>
      <View style={styles.fieldsGroup}>
        <FieldInputWithLabel
          txtInput="Email Address"
          label="Email Address*"
          style={styles.nameField}
          value={orderDetails.customer.name}
          onChangeText={(text) =>
            setorderDetails({
              ...orderDetails,
              customer: { ...orderDetails.customer, name: text },
            })
          }
        ></FieldInputWithLabel>
        <FieldInputWithLabel
          txtInput="Name On Card"
          label="Name On Card*"
          style={styles.nameField}
          value={orderDetails.customer.phoneNumber}
          onChangeText={(text) =>
            setorderDetails({
              ...orderDetails,
              customer: { ...orderDetails.customer, phoneNumber: text },
            })
          }
        ></FieldInputWithLabel>
        <FieldInputWithLabel
          txtInput="1234 1234 1234 1234"
          label="Card Number*"
          style={styles.nameField}
          value={orderDetails.customer.phoneNumber}
          onChangeText={(text) =>
            setorderDetails({
              ...orderDetails,
              customer: { ...orderDetails.customer, phoneNumber: text },
            })
          }
        ></FieldInputWithLabel>
        <View style={styles.buzzCodeAndPhoneRow}>
          <FieldInputWithLabel
            txtInput="MM/YY"
            label="Expiry*"
            style={styles.buzzCodeField}
            value={orderDetails.customer.buzzCode}
            onChangeText={(text) =>
              setorderDetails({
                ...orderDetails,
                customer: { ...orderDetails.customer, buzzCode: text },
              })
            }
          ></FieldInputWithLabel>
          <FieldInputWithLabel
            txtInput="123"
            label="CVV*"
            style={styles.phoneNumberField}
            value={orderDetails.customer.unitNumber}
            onChangeText={(text) =>
              setorderDetails({
                ...orderDetails,
                customer: { ...orderDetails.customer, unitNumber: text },
              })
            }
          ></FieldInputWithLabel>
        </View>
      </View>
      <TouchableOpacity
        style={styles.continueBtn}
        onPress={() => {
          ///
        }}
      >
        <Text style={styles.continueBtnTxt}>CHECKOUT</Text>
      </TouchableOpacity>
    </>
  );
}

const styles = StyleSheet.create({
  container: {
    width: 380,
    height: 390,
  },
  fieldsGroup: {
    width: 380,
    height: 325,
    justifyContent: "space-between",
  },
  nameField: {
    height: 70,
    width: 380,
  },
  addressField: {
    height: 70,
    width: 380,
  },
  buzzCodeAndPhoneRow: {
    width: 380,
    height: 70,
    flexDirection: "row",
    justifyContent: "space-between",
  },
  buzzCodeField: {
    height: 70,
    width: 175,
  },
  phoneNumberField: {
    height: 70,
    width: 175,
  },
  continueBtn: {
    width: 219,
    height: 60,
    backgroundColor: "rgba(238,125,67,1)",
    borderRadius: 60,
    justifyContent: "center",
    alignItems: "center",
    shadowColor: "rgba(0,0,0,1)",
    shadowOffset: {
      width: 3,
      height: 3,
    },
    elevation: 30,
    shadowOpacity: 0.2,
    shadowRadius: 10,
  },
  continueBtnTxt: {
    color: "rgba(255,255,255,1)",
    fontSize: 18,
    fontWeight: "700",
  },
});

export default DeliveryDetails;
